import { useEffect } from "react";
import { useParams } from "react-router";

function AnnonceDetail(props) {

    var { annonceId } = useParams();
    const [annonces, setAnnonces] = useState(props.annonces);
    const [annonce, setAnnonce] = useState(annon);

    useEffect(() => {
        setAnnonce(annonces.filter(aSpace => aSpace.annonceId == annonceId)[0])

    })

    return(
        <div>

            <li>{annonce.title}</li>
            <li>{annonce.annonceId}</li>
        </div>
    )
}

export default AnnonceDetail;
